  return (
    <Helmet title="Panier">
      <CommonSection title="Nos Informations" />
      <div className="app">
        <main className="app-main">
          <Jewelry />
        </main>
        {prods && prods.map(product => (
          <h1 key={product._id}>{product.ref}</h1>
        ))}

      </div>
    </Helmet>
  );
}

export default Contact;
